import React from "react";

class Keys extends React.Component{

    constructor(props){

        super(props);
    }

    render(){
        return(
            <>
                <div style={{color:"mediumorchid"}}>
                    <h1>Keys Controllers</h1>
                    <Numberlist number={numbers}/>
                </div>
            </>
        );
    }
}

function Numberlist(props){
    const listItens = props.numbers.map((number)=>{
        <li>{number}</li>
    });

    return (
        <ul>
            {listItens}
        </ul>
    );
}

const numbers = [1,2,3,4,5];

export default Keys;
